  tambien: "FONPRONVEN also focuses on raising public awareness so that it knows and appreciates Venezuelan rum, identified with the hallmarks of Venezuelan rum and endorsed by the CDO (or D.O.C.) This way you can appreciate the product and differentiate it from other rums.",
  integran: "FONPRONVEN is composed of executives from rum-producing companies in Venezuela: Alcoholes y A\xF1ejos Monagas, Alnova, Central de Licores Unidos de Venezuela C.A. (Celiveca), Complejo Industrial Licorero del Centro, Corporaci\xF3n Alcoholes del Caribe, Destiler\xEDa Car\xFApano, Destiler\xEDas Unidas S.A (DUSA), Destiler\xEDa Veroes, Diageo Venezuela, Industrias Bravo, Ron Santa Teresa and Rones del Caribe.     ",
